import { useState, useEffect } from "react";
import axios from "axios";

const App = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    const res = axios.get(
      "https://leetcode.com/contest/api/ranking/weekly-contest-291/"
    );
    setData(res);
    console.log(res);
  }, []);
  return <div></div>;
};

export default App;
